description:
Raven (Stormy Daniels) is very good at her job, but being an assassin can put a strain on your personal relationships. When Raven decides to hang up her gun belt, her employer turns against her and the assassin becomes a target. A dangerous game of cat and mouse will test Raven. Can she out smart her would be killer (Kaylani Lei)? Or will Raven have the last laugh...

